    container: {
        height: '100vh'
    }
});

export default function SectionSocial(props) {
    const classes = useStyles();
    return (
        <div className={classes.container}>
            <InstagramEmbed
                url='https://www.instagram.com/p/B_SYE5VjswK/'
                maxWidth={420}
                hideCaption={false}
                containerTagName='div'
                protocol=''
                injectScript
                onLoading={() => { }}
                onSuccess={() => { }}
                onAfterRender={() => { }}
                onFailure={() => { }}
            />
        </div>
    );
}
